Event[T].description:
The Event class is used as the base class for the creation of Event objects, which are passed as parameters to event listeners when an event occurs.
<br>
The properties of the Event class carry basic information about an event, such as the event's type or whether the event's default behavior can be canceled. For many events, such as the events represented by the Event class constants, this basic information is sufficient. Other events, however, may require more detailed information.
The methods of the Event class can be used in event listener functions to affect the behavior of the event object.

    typedef SakuraEvent = Event<SakuraEventType>;

    enum abstract SakuraEventType(String) from String to String {
          var LOADING = "loading";
      }

      ExternalEventBus.instance.send(new SakuraEvent(SakuraEventType.PROGRESS, new Progress(0, 0))) ;

EventDispatcher[T].description:
The EventDispatcher class is the base class for all classes that dispatch events. The EventDispatcher class allows any object on the display list to be an event target and as such, to use the methods of the EventDispatcher class.
<br>
In general, the easiest way for a user-defined class to gain event dispatching capabilities is to extend EventDispatcher. If this is impossible (that is, if the class is already extending another class), you can instead create an EventDispatcher member, and write simple hooks to route calls into the aggregated EventDispatcher.

     class ExternalEventBus extends EventDispatcher<SakuraEventType> {

      public static var instance(get, null):ExternalEventBus;
      private static var _instance:ExternalEventBus;

      private function new() {
          super();
      }

      private static function get_instance():ExternalEventBus {
          if (_instance == null) {
             _instance = new ExternalEventBus();
          }
          return _instance;
      }

      public function send(event:Event<SakuraEventType>):Void {
          if (_eventsCallback.exists(event.type)) {
            dispatchEvent(event);
          }
      }

    }

